import React ,{ Component } from 'react';
import { connect } from 'react-redux';
import {
  ListItem,
  ListInfo
} from '../style';

class List extends Component{

  render(){
    const {list} = this.props;
    return(
      <div>
        <ListItem>
          <img className = 'pic' src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTGDCUNlgPpkxYfau1l_OqULlB58tmw5M9kaQ&usqp=CAU' />
          <ListInfo>
            <h3 className='title'>投资者对《2077》不满 律师事务所对CDPR提起集体诉讼</h3>
            <p className='desc'>之前CDPR宣布《赛博朋克2077》全球销量已超过1300万份，使其成为有史以来最成功的RPG游戏之一。但现在一盆冷水泼在CDPR头上了，全球投资者权益律师事务所罗森律师事务所(Rosen Law Firm)宣布，已代表2020年1月16日至2020年12月17日期间CDPR的证券购买者提起了集体诉讼...</p>
          </ListInfo>
        </ListItem>

        
      </div>
    )
  }

}

const mapState = (state) => ({
  list: state.getIn(['home','articleList'])
})

export default connect(mapState)(List);
